import './Hero1.css';
import teacherImg from '../assets/cuate.png'

function Hero1(){
return(
<>
<center className='middleText'> 
<h1>Real Estate-Focused Digital Mastery</h1>
</center>
<div className='heroSection'>

<div className='leftBox'>
<img src={teacherImg} 
alt='digital estate' className='mainPic'/>
</div>
<div className='rightBox'>
<h2>Boost Your Real Estate with Digital Magic</h2>
<p>At Osumare, we get that real estate needs a cool digital vibe 
for property marketing. Our special services are made to 
skyrocket your brand in the digital property world.</p>
<div className='lineThing'></div>
<button className='goButton'>Get started</button>
</div>
</div>
</>
);
}

export default Hero1;
